# recursive, could used to deal with simple string
class Solution2(object):
    def lengthOfLongestSubstring(self, s):
        end_point = len(s)
        if end_point == 0:
            return 0
        if end_point == 1:
            return 1

        beg = 0
        end = 0
        max_len = 0
        longest_list = []
        for i in range(end_point):
            if s[i] in longest_list:
                index1 = longest_list.index(s[i])+1
                sub_str = s[index1:]
                if len(sub_str)<=max_len:
                    return max_len
                max_candi = self.lengthOfLongestSubstring(sub_str)
                if max_candi > max_len:
                    max_len = max_candi
                return max_len
            else:
                longest_list.append(s[i])
                max_len += 1

        return max_len







